        <div> 
            {row.map((r, i) =>{setTimeout(()=>{<Four loyalindex={module[i]} unity={row[i]} carga={carga && carga} key={i} sendFill={sendFill} rows={rows} sendRepsBoxs={sendRepsBoxs} sendRepsCols={sendRepsCols} sendRepsRows={sendRepsRows} sending={sending}/>},500)})}
